import React from 'react';
import EmployeeCard from './EmployeeCard/EmployeeCard.js';

const Employee = ({ data }) => {
  return (
    <div>
      {data.map(employee => (
        <EmployeeCard key={employee.id} {...employee} />
      ))}
    </div>
  );
}

export default Employees;
